import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App"
import "./App.css"


const r = document.getElementById("root")
ReactDOM.render(<App/>, r )
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <App />
);
